#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        int longest = 0;
        int repeatPos = -1;
        
        const int MAX_CHARS = 256;
        vector<int> cache(MAX_CHARS, -1);
        
        int i = 0, N = s.length();
        for (; i < N; i++) {
            const int pos = cache[s[i]];
            if (pos != -1 && repeatPos < pos) {
                repeatPos = pos;
            }
            
            if (i - repeatPos > longest) {
                longest = i - repeatPos;
            }
            
            cache[s[i]] = i;
        }
        
        return longest;
    }
    
};


